import axios from "axios";
import React, { useEffect, useState } from "react";
export const getProduct = async () => {
    const endpoint = "https://localhost:5000/api/Products";
    const response = await axios.get(endpoint)
    return response
};
function Contact(){
    const [users,setUser] = useState([]);
    useEffect(() => {
        axios.get("https://localhost:5000/api/Products").then(({data}) =>{
            setUser(data);
        });
    },[]);
    return(
        <table>
            <thead>
                <tr>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Email</th>
                </tr>
            </thead>
            <tbody>
                {users.map((user) =>(
                    <tr key = {user.id}>
                        <td>{users.id}</td>
                        <td>{users.name}</td>
                        <td>{users.price}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    )
}

export default Contact;
